import React, { Component } from "react";
// import "./App.css";

class App extends Component {
  state = {
    value: "default",
  };

  setValue = (event) => {
    console.log(event);
    this.setState({ value: event.target.value });
  };

  render() {
    return (
      <div className="App">
        <input name="value" value={this.state.value} onChange={this.setValue} />
        <hr />
      </div>
    );
  }
}

export default App;
